script: |
  super -f tsv -I q4683.sql | sort > q4683.out

vector: true

inputs:
  - name: q4683.sql
    data: |
      SELECT ALL COALESCE ( + 8, cor0.col0 * col0, - cor0.col0 * cor0.col1 - - cor0.col1, cor0.col0 ) + cor0.col0 AS col1 FROM tab0 cor0 GROUP BY cor0.col1, col0;
  - name: tab0

outputs:
  - name: q4683.out
    data: |
      34
      51
      91
